export function robotoFonts(jsPDFAPI) {
  const fontNormal =
    // eslint-disable-next-line max-len
    '';

  const fontBold =
    // eslint-disable-next-line max-len
    '';

  const callAddFont = function () {
    this.addFileToVFS('Roboto-Regular.ttf', fontNormal);
    this.addFont('Roboto-Regular.ttf', 'Roboto', 'normal');

    this.addFileToVFS('Roboto-Bold.ttf', fontBold);
    this.addFont('Roboto-Bold.ttf', 'Roboto', 'bold');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}
